import React from 'react';
const Employees = React.lazy(() => import('./views/Add/Employees'));
const Projects = React.lazy(() => import('./views/Add/Projects'));
//const Details = React.lazy(() => import('./views/Details'));
const EEmployees= React.lazy(() => import('./views/Details/EEmployees'))

const routes = [
  { path: '/', exact: true, name: 'Home' },
  //{ path: '/details', name: 'Details', component: Details },
  { path: '/details/eemployees', name: 'Employees Details', component: EEmployees },
  { path: '/add/employee', name: 'Add Employees', component: Employees },
  {path: '/add/project', name: 'Add Project', component: Projects}
];

export default routes;
